import React from "react";
import $ from "jquery";
import { rutaAPI } from "../../config/Config";

class ProspectoModal extends React.Component {
  // $(document).on("click", ".prospecto-btn", function () {
  //   let data = $(this).attr("data");
  //   console.log(data);
  // });

  constructor(props) {
    super(props);
    this.data = null;
    $(document).on("click", ".prospecto-btn", function () {
      var data = $(this).attr("data");
    });

    this.state = { data };
  }

  // async componentDidMount() {
